import React from "react";

const Home = () => {
  const styles = {
    bannerContainer: {
      height: "500px",
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
    },
    bannerFooter: {
      fontWeight: "400",
      fontSize: "32px",
    },
  };

  const displayBanner = (
    <div style={styles.bannerContainer}>
      <div className="text-center lh-1">
        <div style={{ fontSize: "50px" }}>PRODUCTION HOUSE</div>
        <div style={{ fontSize: "85px", fontWeight: "bold" }}>IN METAVERSE</div>
      </div>
      <div>
        <div style={styles.bannerFooter}>
          3D SOLUTION LIKE 3D Digital art, 3D Animation, 3D Game
        </div>
      </div>
    </div>
  );

  return (
    <div>
      <div>{displayBanner}</div>
    </div>
  );
};

export default Home;
